import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Desktop from './Desktop';
import WorkoutSummary from './Components/WorkoutSummary'; // Assuming you have a WorkoutSummary component
import './index.css';


const workoutsData = [
  { name: 'Workout 1', reps: 10, sets: 3, weight: 50 },
  { name: 'Workout 2', reps: 12, sets: 4, weight: 60 },
  // Add more workout data as needed
];

ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" element={<Desktop />} />
      <Route path="/workout-summary" element={<WorkoutSummary workouts={workoutsData}/>} />
      {/* Add more routes as needed */}
    </Routes>
  </Router>,
  document.getElementById('root')
);
